description:
The Stranger (2010)


Canada
Actie / Thriller

geregisseerd door Robert Lieberman
met Steve Austin, Erica Cerra en Adam Beach

Een FBI agent (Adam Beach) en de psycholoog Grace Bishop (Erica Cerra) achtervolgen een recalcitrante agent (Steve Austin) die lijdt aan geheugenverlies.
De agent heeft belangrijke informatie verworven tijdens een traumatische ervaring. Hierdoor is hij een getuige in een uiterst geheim onderzoek geworden.

Vertaling: Dejavu en Orlandoli

